import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import UserProfileModel from "./UserProfileModel";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import "./Dashboard.css";

function Dashboard() {
  const [userData, setUserData] = useState({});
  const [userEvents, setUserEvents] = useState([]);
  const [scheduledEvents, setScheduledEvents] = useState([]);
  const [showUserProfileModal, setShowUserProfileModal] = useState(false);
  const [isLoading, setIsLoading] = useState(true);
  const [searchQuery, setSearchQuery] = useState("");
  const [darkMode, setDarkMode] = useState(false);
  const token = localStorage.getItem("token");

  useEffect(() => {
    if (token) {
      fetchUserData(token);
      fetchUserEvents(token);
      fetchScheduledEvents(token);
    }
  }, [token]);

  const fetchUserData = async (token) => {
    try {
      const response = await fetch("https://ticket-a8ez.onrender.com/user", {
        headers: {
          Authorization: `${token}`,
          "Content-Type": "application/json",
        },
      });
      if (response.ok) {
        const data = await response.json();
        setUserData(data);
      }
    } catch (error) {
      toast.error("Error fetching user data!");
    }
  };

  const fetchUserEvents = async (token) => {
    try {
      const response = await fetch("https://ticket-a8ez.onrender.com/event", {
        headers: {
          Authorization: `${token}`,
          "Content-Type": "application/json",
        },
      });

      if (response.ok) {
        const data = await response.json();
        setUserEvents(data.userEvents);
      }
    } catch (error) {
      toast.error("Error fetching user events!");
    } finally {
      setIsLoading(false);
    }
  };

  const fetchScheduledEvents = async (token) => {
    try {
      const response = await fetch("https://ticket-a8ez.onrender.com/ticket/user", {
        headers: {
          Authorization: `${token}`,
          "Content-Type": "application/json",
        },
      });
      if (response.ok) {
        const data = await response.json();
        setScheduledEvents(data.userTickets);
      }
    } catch (error) {
      toast.error("Error fetching scheduled events!");
    }
  };

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
    document.body.classList.toggle("dark-mode");
  };

  return (
    <div className={`dashboard ${darkMode ? "dark" : ""}`}>
      <ToastContainer />

      {/* Navbar */}
      <nav className="navbar">
        <div className="left">
          <Link to={"/dashboard"}>üè† Dashboard</Link>
        </div>
        <div className="right">
          <button className="btn" onClick={toggleDarkMode}>
            {darkMode ? "üåô Dark Mode" : "‚òÄÔ∏è Light Mode"}
          </button>
          <button className="btn" onClick={() => setShowUserProfileModal(true)}>üë§ Profile</button>
        </div>
      </nav>

      {/* Welcome Message */}
      <div className="welcome">
        <h2>Welcome, {userData.name || "User"}! üéâ</h2>
      </div>

      {/* Search Bar */}
      <div className="search-bar">
        <input
          type="text"
          placeholder="üîç Search events..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
      </div>

      {/* Events Section */}
      <div className="section">
        <h3>üìÖ Your Events</h3>
        {isLoading ? (
          <div className="loader">Loading...</div>
        ) : (
          userEvents
            .filter(event => event.title.toLowerCase().includes(searchQuery.toLowerCase()))
            .map((event) => (
              <div key={event._id} className="event-card">
                <h4>{event.title}</h4>
                <p>{event.description}</p>
                <p>üìç {event.venue}</p>
                <p>üìÖ {new Date(event.date).toDateString()}</p>
              </div>
            ))
        )}
      </div>

      {/* User Profile Modal */}
      {showUserProfileModal && <UserProfileModel onClose={() => setShowUserProfileModal(false)} />}
    </div>
  );
}

export default Dashboard;
